import { BrowserRouter as Router, Route, Link } from 'react-router-dom';

import { Logo } from './images/logo1.png';

import GlobalStyle from './styles/globalStyle';

function App() {
  return (
    <div className="App">
      <GlobalStyle />
      <Logo />
      <header className="App-header"></header>
    </div>
  );
}

export default App;
